  Evelyn, d/o George and Edith Pinckney of Glenaray, Waikaia, Southland and widow of Basil Unwin.
  01> WILLIAMS, David Empson m on ** ** **** to (3) FAULKNER, Muriel Mary
  b 06.05.1910 d 07.12.1977
  b 23.10.1914 d 22.09.1991
  Mary, d/o Muriel Buchanan Williams and Albert Joseph Faulkner, b. at Gisborne. She was educated at
  Woodford House and trained as a Karitane nurse. She worked in the cipher office during WW2. Mary was
  the Hawkes Bay amateur rose-growing champion for several years. She was also a printmaker and
  craftsperson, and was also a prison counsellor at Turangi. She continued to produce fine roses and
  dahlias at Turangi and worked hard for the Red Cross there. She moved to Gisborne when she lost some
  of her sight, but was still able to garden until the end of her life.
  02> WILLIAMS, Stephen Empson m on 24.09.1940 to FIRTH, Joyce Patricia
  b 02.11.1911 d 16.10.1995
  b 15.09.1908 d 08.09.1986
  Stephen b. at Otane, Hawkes Bay and m. at Melbourne, Australia. Patricia, d/o Patrick B Fitzherbert and
  Emily V Fookes, b. at Dannevirke.
  Stephen was educated at Hereworth School and Wanganui Collegiate School and graduated from Otago
  University (Medical Course) in 1937. He worked at the Auckland Public Hospital until 1939 when he
  moved to Australia, married, and was a Major in the Australian Army Medical Corps (1944-47). He was
  pathologist at the Sydney Children's Hospital and returned to New Zealand in 1950 to work as
  Pathologist with the Auckland Hospital Board. In 1961 he became Director of Laboratory Services and in
  1968, Pathologist-in-Charge of the Cytology Laboratory, National Women's Hospital until his retirement
  in 1976.
